defs.script:

function init(evt)
{
  if ( window.svgDocument == null ) {
    svgDocument = evt.target.ownerDocument;
  }
  tooltip = svgDocument.getElementById('tooltip');    
  tooltip_bg = svgDocument.getElementById('tooltip_bg');
  if (typeof svgevents_load === "function") {
    svgevents_load(svgDocument);
  }
}

function ShowTooltip(evt)
{
  if (typeof svgevents_hover === "function") {
    if(false === svgevents_hover(evt.target.getAttributeNS(null,"id"),  evt.target.getAttributeNS(null,"name"))) {
      return;
    }
  }

  var pathdata = evt.target.getAttributeNS(null, "d");
  var tmpidx = pathdata.indexOf("l");
  var pathYpos = 0;

  var tooltipXpadding = 20;
  var tooltipYpadding = 14;
  var tooltipX = 700;
  var tooltipY = 400;

  if (tmpidx > 0) {
    pathdata = pathdata.substr(0, tmpidx);
    tmpidx = pathdata.indexOf(" ");
    if (tmpidx < 0) {
      tmpidx = pathdata.indexOf(",");
    }
    if (tmpidx > 0) {
      pathdata = pathdata.substr(tmpidx+1);
      pathYpos = parseFloat(pathdata);
    }
  }

  if (pathYpos > 1000) {
    tooltipX = 200;
    tooltipY = 1350;
  } else if (pathYpos > 700) {
    tooltipX = 30;
    tooltipY = 890;
  }

  tooltip.setAttributeNS(null,"x",tooltipX);
  tooltip.setAttributeNS(null,"y",tooltipY);
  tooltip.firstChild.data = evt.target.getAttributeNS(null,"name");
  tooltip.setAttributeNS(null,"visibility","visible");      

  length = tooltip.getComputedTextLength();
  tooltip_bg.setAttributeNS(null,"height",40);
  tooltip_bg.setAttributeNS(null,"width",length+(tooltipXpadding*2));
  tooltip_bg.setAttributeNS(null,"x",tooltipX-tooltipXpadding);
  tooltip_bg.setAttributeNS(null,"y",tooltipY-28);
  tooltip_bg.setAttributeNS(null,"visibility","visibile");
  tooltip_bg.setAttributeNS(null,"fill",evt.target.getAttributeNS(null,"fill"));
}

function HideTooltip()
{
  tooltip.setAttributeNS(null,"visibility","hidden");
  tooltip_bg.setAttributeNS(null,"visibility","hidden");
}
